    document.getElementById("maintableName" + i).textContent = driverNames[i];
    document.getElementById("maintableLap" + i).textContent = driverArrays[i][0];
    document.getElementById("maintablePlace" + i).textContent = driverArrays[i][5];
  }
  for (let i = 0; i < name.length; i++) {
    //other drivers
    document.getElementById("tableName" + i).textContent = name[i];
  }

  /*num of cars must be <=5*/
  const numCars = 3;
  let startPos = []; /*adjusted start pos based on total time*/
  if (buttonCount >= 0) {
    for (let i = 0; i < numCars; i++) {
      let rad = 2 * Math.PI;
      if (driverArrays[i][4] < zeroTime) {
        startPos[i] = rad * (-1 / timeScaler + 1 / currentAverageSpeed[i]) * (zeroTime - driverArrays[i][4]);
      } else {
        startPos[i] = rad * (1 / averageSpeed[i]) * (zeroTime - driverArrays[i][4]);
      }
      console.log(currentAverageSpeed[i]);
    }
    //parseData(testTimes[buttonCount]); //but do new data here instead of that
  }

