    elem[i] = document.getElementById("animate" + i);
  }
  for (let i = 4; i >= numCars; i--) {
    document.getElementById("animate" + i).style.visibility = "hidden";
  }
  let bounds = 400;
  let carWidth = 30;
  let carHeight = 60;
  let xPosStart = -10 + (bounds - carWidth) / 2;
  let yPosStart = (bounds - carHeight) / 2;
