  let reset = 0;
  let t = [Math.PI / 2, Math.PI / 2, Math.PI / 2, Math.PI / 2, Math.PI / 2]; /*starting position on 0 rad*/
  let rot = 0;
  clearInterval(id);
  id = setInterval(frame, 5);
  let animationActive = 1;
  function frame() {
    for (let i = 0; i < numCars; i++) {
      t[i] += animationActive * (0.0077 * timeScaler / times[i] * (Math.pow(slider.value / 50, 2) + 0.25)); /*max slider of 4 min of .25*/
      let tOffset = startPos[i]; /*(i * Math.PI) / (numCars / 2);*/
      let maxRadius = 195 - carWidth / 2;
      xPos = xPosStart + (maxRadius - (carWidth + 2) * (numCars - i - 1)) * Math.cos(t[i] + tOffset) + 10;
      yPos = yPosStart + (maxRadius - (carWidth + 2) * (numCars - i - 1)) * Math.sin(t[i] + tOffset);
      let timeSeconds = zeroTime + t[0] / 2 / Math.PI * 90;
      let timeMins = timeSeconds / 60;
      let timeHours = timeMins / 60;
      let formatedTime = "";
      if (timeHours !== 0) formatedTime += Math.floor(timeHours) + ":";
      if (timeMins % 60 <= 9) formatedTime += "0";
      formatedTime += Math.floor(timeMins % 60) + ".";
      if (timeSeconds % 60 <= 9) formatedTime += "0";
      formatedTime += Math.floor(timeSeconds % 60);
