      elem[i].style.transform = "rotate(" + (180 + -180 / Math.PI * (t[i] + tOffset)) + "deg)";
      elem[i].style.top = xPos + "px";
      elem[i].style.left = yPos + "px";
      if (!reset && t[0] > -0.1 + 5 * Math.PI / 2) {
        animationActive = 0;
        clearInterval(id);
        startNextLap();
        reset = 1;
        //console.log("lap complete");
      }
    }
  }
}

